import React from 'react'



const Product = ({id,title,price,description,category,image,rating}) =>{


    return(
        <div key={id}>
            <img src={image} alt={category}/>
            <h1>{title} - {price}</h1>
            <h2>{rating} - Comes under the category of {category}</h2>
            <h3>{description}</h3>
        </div>
    )
}

export default Product
